import React from "react";

function PopupWithConfirm () {
    return (
        <div class={`popup ${props.isOpen && `popup_opened`}`} id="popup-confirm">
            <div class="popup__container" id="popup__container-confirm">
                <h2 class="popup__title popup__title_confirm">Вы уверены?</h2>
                <form action="#" name="confirmForm" class="popup__form" id="popup__confirm" novalidate>
                    <fieldset class="popup__fieldset">
                        <button class="popup__button-save" type="submit" id="popup__button-confirm">Да</button>
                    </fieldset>
                </form>
                <button class="popup__button-exit" type="button"></button>
            </div>
        </div>
    )
}

export default PopupWithConfirm;
